import React from 'react';
import "./Player.css"
import { useLocation } from 'web3uikit/node_modules/react-router';
import { Link } from 'react-router-dom';

const Player = () => {
  
  return (
  <>
  <div className="container">
  <Link to="/" className="link">Home</Link>
  </div>
  </>
)
}

export default Player;
